DROP TABLE IF EXISTS `tb_pic`;
CREATE TABLE `tb_pic` (
  `picid` int(11) NOT NULL AUTO_INCREMENT,
  `userid` int(11) DEFAULT NULL,
  `picurl` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `pictitle` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `uploadtime` datetime DEFAULT NULL,
  `piccontent` varchar(5000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片识别内容',
  `status` int(11) DEFAULT NULL,
  PRIMARY KEY (`picid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

